	if (cookiePart.length === 2) {
		this.userFromEEA = cookiePart.pop().split(";").shift();
	}
	
	//get CountryCode cookie status
	var cookie = ("; " + document.cookie);
	var cookiePart = cookie.split(("; " + "CountryCode" + "="));
	if (cookiePart.length === 2) {
		this.CountryCode = cookiePart.pop().split(";").shift();
	}

	//disable cmp in iframe
	if(this.inIframe()) {
		this.userFromEEA = "false";
	}

