aipAPI.prototype.checkBidders = function() {
	var aRemoveBidders = [];

	//exclude bidders from country
	var excludeBidders = {
		'pubmatic': ['RU', 'UA', 'BY', 'RS', 'VE', 'LB', 'BA', 'MK', 'AL', 'IQ', 'ZW', 'ME', 'TM', 'PF', 'TJ', 'LY', 'SO', 'GP', 'AX', 'YE', 'AD', 'CD', 'MC', 'GA'],
		'rhythmone': ['TR', 'ID', 'VN', 'EG']
	};
	for (const key in excludeBidders) {
		if(aipAPItag.inArray(this.CountryCode, excludeBidders[key])!= -1){
			aRemoveBidders.push(key);
			aipAPItag.log("Removing bidder "+key+" from all AdUnits because user is from: "+this.CountryCode);
		}
	}

	//include bidder in countries only
	var includeBidders = {
		'sonobi': ['US', 'CA', 'MX']
	};
	for (const key in includeBidders) {
		if(aipAPItag.inArray(this.CountryCode, includeBidders[key])== -1){
			aRemoveBidders.push(key);
			aipAPItag.log("Removing bidder "+key+" from all AdUnits because user is from: "+this.CountryCode);
		}
	}
	
	//remove rubicon when in iframe
	if(this.inIframe()) {
		aRemoveBidders.push("rubicon");
	}

	//removeBidders
	if(aRemoveBidders.length > 0) {
		//removeBidders from display
					this.removeBidders(this.adUnits['shellshockers_titlescreen'], aRemoveBidders);
					this.removeBidders(this.adUnits['shellshockers_chicken_nugget_banner'], aRemoveBidders);
					this.removeBidders(this.adUnits['shellshock-io-twitch_970x250'], aRemoveBidders);
					this.removeBidders(this.adUnits['shellshockers_respawn_banner'], aRemoveBidders);
					this.removeBidders(this.adUnits['shellshockers_respawn_banner-pr2'], aRemoveBidders);
					this.removeBidders(this.adUnits['shellshockers_respawn_banner-sh'], aRemoveBidders);
					this.removeBidders(this.adUnits['shellshockers_respawn_banner-new'], aRemoveBidders);
					this.removeBidders(this.adUnits['shellshockers_respawn_banner_2-pr'], aRemoveBidders);
					this.removeBidders(this.adUnits['shellshockers_respawn_banner_2-sh'], aRemoveBidders);
		
		//removeBidders from preroll
							this.removeBidders([this.videoAdUnit["shellshock.io_preroll"]], aRemoveBidders);
										this.removeBidders([this.videoAdUnit["shellshock.io_rpreroll_30s"]], aRemoveBidders);
						}
}

